import{_ as t,o as i,c as a,z as e,a as o}from"./chunks/framework.9482e208.js";const g=JSON.parse('{"title":"§ 17.1-309 Jurisdiction of writs of mandamus and prohibition.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/17.1-309.md","filePath":"vacode/17.1-309.md"}'),r={name:"vacode/17.1-309.md"},n=e("h1",{id:"§-17-1-309-jurisdiction-of-writs-of-mandamus-and-prohibition",tabindex:"-1"},[o("§ 17.1-309 Jurisdiction of writs of mandamus and prohibition. "),e("a",{class:"header-anchor",href:"#§-17-1-309-jurisdiction-of-writs-of-mandamus-and-prohibition","aria-label":'Permalink to "§ 17.1-309 Jurisdiction of writs of mandamus and prohibition."'},"​")],-1),s=e("p",null,"The Supreme Court shall have jurisdiction to issue writs of mandamus and prohibition to the circuit and district courts, the Court of Appeals, and to the State Corporation Commission and in all other cases in which such writs, respectively, would lie according to the principles of the common law. Provided that no writ of mandamus, prohibition or any other summary process whatever shall issue in any case of the collection of revenue or attempt to collect the same, or to compel the collecting officers to receive anything in payment of taxes except such money as is legal tender for the payment of revenue, or in any case arising out of the collection of revenue in which the applicant for the writ of process has any other remedy adequate for the protection and enforcement of his individual right, claim and demand, if just.",-1),c=e("p",null,[o("Code 1919, § 5864, § 17-96; 1998, c. "),e("a",{href:"http://lis.virginia.gov/cgi-bin/legp604.exe?981+ful+CHAP0872",target:"_blank",rel:"noreferrer"},"872"),o("; 2021, Sp. Sess. I, c. "),e("a",{href:"http://lis.virginia.gov/cgi-bin/legp604.exe?212+ful+CHAP0489",target:"_blank",rel:"noreferrer"},"489"),o(".")],-1),d=[n,s,c];function h(l,f,p,m,u,_){return i(),a("div",null,d)}const w=t(r,[["render",h]]);export{g as __pageData,w as default};
